import React, { useState } from 'react';
import { Container, Row, Col, Form, Button, Card } from 'react-bootstrap';

const RegisterLogin = () => {
  const [isRegister, setIsRegister] = useState(true);
  const [form, setForm] = useState({
    email: '',
    name: '',
    password: ''
  });

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (isRegister) {
      // Registration logic here
      alert(`Registered with: ${form.email}, ${form.name}`);
    } else {
      // Login logic here
      alert(`Logged in with: ${form.email}`);
    }
  };

  return (
    <div style={{ minHeight: '100vh', background: '#fff', display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
      <Container>
        <Row className="justify-content-center">
          <Col md={6} lg={5}>
            <Card className="shadow p-4">
              <Card.Body>
                <div className="text-center mb-4">
                  <img src="/logo192.png" alt="ConnectNinja" style={{ width: 48, marginBottom: 8 }} />
                  <h2 className="mb-2" style={{ fontWeight: 700 }}>ConnectNinja</h2>
                  <h4 className="mb-4" style={{ fontWeight: 600 }}>{isRegister ? "Let's get your account set up" : 'Log in'}</h4>
                </div>
                <Form onSubmit={handleSubmit}>
                  <Form.Group className="mb-3" controlId="formEmail">
                    <Form.Label>Email</Form.Label>
                    <Form.Control
                      type="email"
                      name="email"
                      placeholder="Enter your email"
                      value={form.email}
                      onChange={handleChange}
                      required
                    />
                  </Form.Group>
                  {isRegister && (
                    <Form.Group className="mb-3" controlId="formName">
                      <Form.Label>Name</Form.Label>
                      <Form.Control
                        type="text"
                        name="name"
                        placeholder="Enter your name"
                        value={form.name}
                        onChange={handleChange}
                        required
                      />
                    </Form.Group>
                  )}
                  <Form.Group className="mb-4" controlId="formPassword">
                    <Form.Label>Password</Form.Label>
                    <Form.Control
                      type="password"
                      name="password"
                      placeholder="Set a password"
                      value={form.password}
                      onChange={handleChange}
                      required
                    />
                  </Form.Group>
                  <Button type="submit" className="w-100 mb-3" variant="primary">
                    {isRegister ? 'Sign Up' : 'Log In'}
                  </Button>
                </Form>
                <div className="text-center">
                  {isRegister ? (
                    <>
                      <span>Already have an account?{' '}</span>
                      <Button variant="link" onClick={() => setIsRegister(false)} style={{ padding: 0 }}>Log in instead</Button>
                    </>
                  ) : (
                    <>
                      <span>Don't have an account?{' '}</span>
                      <Button variant="link" onClick={() => setIsRegister(true)} style={{ padding: 0 }}>Create an account</Button>
                    </>
                  )}
                </div>
              </Card.Body>
            </Card>
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default RegisterLogin;
